import React from 'react';
import HeroeList from "../heroes/HeroeList";

const All = () => {
    return (
        <div>
            <h1 className="mt-5 ms-5">DC</h1>
            <hr />
            <h2>DC Comics</h2>
            <HeroeList publisher='DC Comics' />
            <hr />
            <h2>DC Comics</h2>
            <HeroeList publisher='Marvel' />

        </div>
    );
};

export default All;
